import React from 'react';
import HeatMapChart from './charts/heatMapChart';
import { Box } from '@mui/material';

function Dashboard() {
  return (
    <Box>
      <HeatMapChart chartName="Digital Affinity" />
      <HeatMapChart chartName="Personal Promotion Affinity" />
      <HeatMapChart chartName="Peer to Peer Affinity"/>
    </Box>
  )
}

export default Dashboard
